import {CategoryItem} from '../Category/CategoryItem'


function CategoryList({catalog = []}){
    return (

        <div className="list">
            {catalog.map(el => (
                <CategoryItem key={el.idCategory} {...el} />
            ))}
        </div>

    )
}

export {CategoryList}
